    false,nt"url": null,nt"notes": "The Financial Processing Centers layer
    consists of the following> Defense Finance and Accounting Services (DFAS) > DFAS
    like services associated with non DOD Federal Agencies > State Government Payment
    Centers > Internal Revenue Service payment centers (the IRS calls these 'Taxpayers
    Assistance Centers' > Check clearing houses including Federal Reserve locations
    that act as check clearing houses > Credit card payment processing centers > Defense
    Finance and Accounting Services provide accounting and finance services for military
    departments and defense agencies. Non-Defense Federal Government Equivalent agencies
    provide accounting and finance services for non-military government agencies. Internal
    Revenue Service Taxpayers Assistance Centers provided payment arrangements, account
    inquiries, adjustments, tax forms and preparation, and accepts payments. State Government
    Payment Centers provide payroll services for state government employees. Credit
    card clearinghouses participate in the transfer of funds for a credit card. And
    check clearinghouses participate in the transfer of funds for a check transaction.
    The basis of this dataset was information gathered from official internet websites
    for the agencies represented in this dataset, as well as other public domain and
    open source research. The name, address, phone number and geospatial location for
    90% of the entities were completely verified by TGS. The locations for the balance
    of the entities were assigned using automated methods. Text fields in this dataset
    have been set to all upper case to facilitate consistent database engine search
    results. All diacritics (e.g. the German umlaut or the Spanish tilde) have been
    replaced with their closest equivalent English character to facilitate use with
    database systems that may not support diacritics. The currentness of this dataset
    is indicated by the [CONTDATE] attribute. Based upon this attribute the oldest record
    dates from 09/25/2006 and the newest record dates from 10/02/2006.",nt"license_title":
